import { useEffect, useState } from "react";
import axios from "axios";

import Card from "../components/Card";
import Sand from '../assets/vehicles/sandcrawler.png'


export default function Vehicles() {
    useEffect(() => {
        getSWAPI()
    }, [])
    const [vehicles, setVehicles] = useState(Object) 

    async function getSWAPI() {

        const URL = 'https://swapi.dev/api/vehicles/?page=1'
        const response = await axios.get(URL)

        setVehicles(response.data)
    }



    console.log(vehicles.results)
    setTimeout(() => {
        return (
            <div className="h-auto w-screen">
                <div className="shadow-xl py-8 text-6xl text-gray-600 w-screen text-center">
                    <h1>Ve√≠culos</h1>
                </div>
                <div className="w-screen grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 place-items-center mt-10">
                    {
                        vehicles?.results.map( 
                            (vehicle: {
                                name: String,
                                cost_in_credits: String
                            }) => {
                                return(
                                    <div className="mt-6">
                                        <Card img={Sand}
                                            name={vehicle.name}
                                            price={vehicle.cost_in_credits}
                                        />
                                    </div>
                                );
                        })
                    }
                </div>
            </div>
        )
    }, 500)
}
